import React, { Component } from "react";
import Slider from "react-slick";
import girl from '../photos/girl.jpg'


export default class Girls extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 3
        };
        return (
            <div>
                <h2> Multiple items </h2>
                <Slider {...settings}>
                    <div>
                        <img src={girl}></img>
                        <h3>1</h3>
                    </div>
                    <div>
                        <h3>2</h3>
                    </div>
                    <div>
                        <h3>3</h3>
                    </div>
                    <div>
                        <h3>4</h3>
                    </div>
                    <div>
                        <h3>5</h3>
                    </div>
                </Slider>
            </div>
        );
    }
}
